import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';

// Global stil dosyasını import ediyoruz. Tüm uygulama bu stilleri temel alacak.
import './App.css';

// Uygulamadaki tüm sayfaları (bileşenleri) import ediyoruz.
import LoginPage from './LoginPage';
import ForgotPasswordPage from './ForgotPasswordPage';
import Dashboard from './Dashboard';
import VehiclesPage from './VehiclesPage';
import PersonnelPage from './PersonnelPage';
import CreditCalculatorPage from './CreditCalculatorPage';
import MarketValuePage from './piyasa';

function App() {
  return (
    // Router, sayfa geçişlerini yönetir.
    <Router>
      <Routes>
        {/* Her bir yol (path) için hangi sayfanın (element) gösterileceğini belirtiyoruz. */}
        <Route path="/" element={<LoginPage />} />
        <Route path="/forgot-password" element={<ForgotPasswordPage />} />
        <Route path="/dashboard" element={<Dashboard />} />
        <Route path="/vehicles" element={<VehiclesPage />} />
        <Route path="/personnel" element={<PersonnelPage />} />
        <Route path="/kredi" element={<CreditCalculatorPage />} />
        <Route parh="/piyasa" element={<MarketValuePage/>}/>
      </Routes>
    </Router>
  );
}

export default App;
